from typing import List


class Solution:
    def minimumHammingDistance(self, source: List[int], target: List[int], allowedSwaps: List[List[int]]) -> int:
        n = len(source)

        v = [0 for i in range(n)]
        g = [[] for i in range(n)]

        edict = {}
        for e in allowedSwaps:
            if edict.get(tuple(e),0) == 0:
                edict[tuple(e)]=1
                g[e[0]].append(e[1])
                g[e[1]].append(e[0])


        self.path = []
        def dfs(s):
            for ni in g[s]:
                if v[ni]== 0:
                    v[ni] = 1
                    self.path.append(ni)
                    dfs(ni)

        #print("start")
        pathstack = []
        for i in range(n):
            if v[i] ==0:
                dfs(i)
                if len(self.path) > 0:
                    #self.path.append(i)
                    #print(self.path)
                    pathstack.append(self.path)
                    self.path=[]

        #print(pathstack)
        r={}
        self.ok = 0
        #oklist = []
        for p in pathstack:
            a={}
            b={}
            for node in p:
                tmp = source[node]
                a[tmp] = a.get(tmp,0)+1
                tmp = target[node]
                b[tmp] = b.get(tmp, 0) + 1
                v[node] = 1

            for k in a.keys():
                if b.get(k)!=None:
                    tmp = min(a[k], b[k])
                    cnt = r.get(k,0)
                    r[k] = tmp + cnt
                    #oklist.append(k)

                    #if k == 34267:
                    #    bbb+=1

        for k in r:
            self.ok+=r[k]
        #print("1",self.ok)

        #oklist2 = []
        for i in range(n):
            if v[i] == 0 and source[i] == target[i]:
                self.ok+=1
                #oklist2.append(source[i])
        #print("2",self.ok)

        #oklist.sort()
        #oklist2.sort()
        #print(n)
        #print(n - (len(oklist) + len(oklist2)))
        #print(len(oklist))
        #print(len(oklist2))

        #print("last",self.ok,n,n-self.ok)
        #print("end",self.ok)
        return n-self.ok

